import React, { useState } from 'react';
import styled from 'styled-components';
import ResumeDetailBody from './ResumeDetailBody';
import ResumeDetailFooter from './ResumeDetailFooter';
import ResumeDetailToolbar from './ResumeDetailToolbar';

function CvMakePage() {
	const [introduction, setIntroduction] = useState('');
	return (
		<ComponentWrapper>
			<ResumeDetailToolbar />
			<ResumeDetailBody setIntroduction={setIntroduction} />
			<ResumeDetailFooter />
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	width: 87.72%;
	padding: 0;
	max-width: 1060px;
	margin: 0 auto;
`;

export default CvMakePage;
